import './App.css';
import React, { useState, } from 'react';
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";
import About from "./Components/About"
import Resume from "./Components/Resume"

function App() {
  const [aboutFocus, setAboutFocus] = useState(true)
  const [resumeFocus, setResumeFocus] = useState(true)
  return (
    <div className="App">
      <Navbar aboutFocus={(e) => console.log(e)} resumeFocus={(e) => setResumeFocus(e)} />
      <Section
        content = {About(aboutFocus)}
        dark={false}
        id="section1"
      />
      <Section
        content = {Resume(resumeFocus)}
        dark={true}
        id="section2"
      />
      <Section
        content = {dummyText}
        dark={false}
        id="section3"
      />
    </div>
  );
}

export default App;
